const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>Sasuvika Consultancy Inc</h1>
      <div className="links">
        <a href="/"  style={{ 
          color: 'white', 
          backgroundColor: '#4c9e7f',
          borderRadius: '8px' 
        }}>Home</a>
        <a href="/create" style={{ 
          color: 'white', 
          backgroundColor: '#4c9e7f',
          borderRadius: '8px' 
        }}>New Blog</a>
        <a href="/"  style={{ 
          color: 'white', 
          backgroundColor: '#4c9e7f',
          borderRadius: '8px' 
        }}>Contact us</a>
      </div>
    </nav>
  );
}

export default Navbar;
